# Split data into clusters
def process_cluster_data(df_encoded, cluster_column='Cluster', target_column='Attrition'):
    cluster_data = {}

    # Loop through each cluster and drop cluster + attrition columns
    # Split into X and Y for model construction
    for cluster in df_encoded[cluster_column].unique():
        cluster_df = df_encoded[df_encoded[cluster_column] == cluster]
        y = cluster_df[target_column]
        X = cluster_df.drop(columns=[cluster_column, target_column])

        cluster_data[cluster] = {'X': X, 'y': y}

    return cluster_data

